import React from 'react';
import '../styles/NewArrivals.css';

const NewArrivals = () => {
  return (
    <div className="new-arrivals">
      <h2>New Arrivals</h2>
      <div className="new-arrivals-grid">
        <div className="new-arrival-item">
          <img src="https://www.jiomart.com/images/product/original/rvaid17rkf/fabyarn-women-s-girls-fashion-collection-stylish-dresses-tops-frocks-ethnic-wear-lehenga-choli-casual-party-outfits-trendy-accessories-perfect-for-every-occasion-size-5-6-y-product-images-rvaid17rkf-3-202409261644.jpg?im=Resize=(500,630)" alt="Product 1" />
          <h4>Product Name</h4>
          <p>Price: $20</p>
          <button className="view-details-btn">View Details</button>
        </div>
        <div className="new-arrival-item">
          <img src="https://explorehonor.com/cdn/shop/files/magic6-pro-black-1_280x315@2x.jpg?v=1722237754" alt="Product 2" />
          <h4>Product Name</h4>
          <p>Price: $30</p>
          <button className="view-details-btn">View Details</button>
        </div>
      </div>
    </div>
  );
};

export default NewArrivals;
